As I’ve gotten older and the band has gotten bigger I’ve started to struggle with performance anxiety in a way I never had before. In some sense I was dreading this big final show at Radio City and how my nerves would destroy my body on the days leading up to it. I often stop eating entirely and my health has started to suffer under the pressure of working hard enough to believe I deserve all this. But then the day of the show a strange calm came over me as I witnessed all the work and care of this team of brilliant people that I’ve been so fortunate to fold into my life and career. I realized I’m really just a small part of it all and I thought—I’m just going to have fun again.

We’ve got just one more on the books (Halloween in Philly) before I am off to live in Seoul for all of 2024. Japanese Breakfast will be taking a much needed year long sabbatical after two and a half years of touring for Jubilee. I am looking forward to living as a student in Korea, learning the language and documenting the process for my second book. I am also looking forward to all of the inspiring projects my bandmates and crew are sure to create for us all to gush over in the interval and celebrate together when I return.

Photos by @saladjockey 

I love you all more than you could ever know. Thank you.
